const realtimeTransByAjaxtexts = function (wordsObj) {
    var keys = Object.keys(wordsObj);
    $('.data-ajax').each(function(){
        if($(this).is('input'))
        {
            var plh=$(this).attr('placeholder');
            if(plh!==undefined && plh!==null && plh!=='')
            {
                if(plh.split(',').length > 1)
                {
                    var keystrarrys= plh.split(',');
                    var trans_txt='';
                    for(var i=0;i < keystrarrys.length;i++)
                    {
                        var item = $.trim(keystrarrys[i]);
                        for (var j = 0; j < keys.length; j++) {
                            if(keys[j]===item){
                                trans_txt += wordsObj[keys[j]]+' ';
                                break;
                            }
                        }
                    }
                    trans_txt = $.trim(trans_txt);
                    $(this).attr('placeholder',trans_txt);
                }
                else
                {
                    var trans_txt='';
                    for (var i = 0; i < keys.length; i++) {
                        if(keys[i]===plh){
                            trans_txt = wordsObj[keys[i]];
                            $(this).attr('placeholder',trans_txt);
                            break;
                        }
                    }
                }
            }
        }
        else
        {
           var findkeystr=$(this).attr('data-ajax');
            if(findkeystr!==undefined && findkeystr!==null && findkeystr!=='')
            {
                if(findkeystr.split(',').length > 1)
                {
                    //console.log('txt=>'+findkeystr+' len=>'+findkeystr.split(',').length);
                    var keystrarrys= findkeystr.split(',');
                    var trans_txt='';
                    for(var i=0;i < keystrarrys.length;i++)
                    {
                        var item = $.trim(keystrarrys[i]);
                        for (var j = 0; j < keys.length; j++) {
                            if(keys[j]===item){
                                trans_txt += wordsObj[keys[j]]+' ';
                                break;
                            }
                        }
                    }
                    trans_txt = $.trim(trans_txt);
                    $(this).text(trans_txt);
                }
                else
                {
                    var trans_txt='';
                    for (var i = 0; i < keys.length; i++) {
                        if(keys[i]===findkeystr){
                            trans_txt = wordsObj[keys[i]];
                            $(this).text(trans_txt);
                            break;
                        }
                    }
                }
            }//undefound
        }

    });
}

const getByAjaxtext = function (wordsObj, findkeystr) {
    if(findkeystr===null || findkeystr ==='') return '';
    var keys = Object.keys(wordsObj);
    var trans_txt='';
    for (var i = 0; i < keys.length; i++) {
        if(keys[i]===findkeystr){
            trans_txt = wordsObj[keys[i]];
            break;
        }
    }
    return trans_txt;
}

const forEachProp = function forEachProp(obj, dataobj, callback) {
    var keys = Object.keys(obj);
    for (var i = 0; i < keys.length; i++) {
        callback(dataobj, keys[i], obj[keys[i]]);
    }
};
const htmldecodejs = function (tag) {
    var ret = tag.replace(/&gt;/g, '>');
    ret = ret.replace(/&lt;/g, '<');
    ret = ret.replace(/&quot;/g, '"');
    ret = ret.replace(/&apos;/g, "'");
    ret = ret.replace(/&amp;/g, '&');
    return ret;
}

