const permissionDefinition = function () {
    var self_per = vueNavOBJ.$store.state.permission;
    var manager = nav_module.data.jsonparse(window.Laravel.userinfo).manager;
    var permissions = nav_module.data.jsonparse(window.Laravel.permissions);

    var obj = {
        pread:1,
        pwrite:1,
        pcreate:1,
        pdelete:1
    };
    if(manager == "default_User") {
        for (var i = 0; i < permissions.length; i++) {
            if (permissions[i].menu_id == self_per) {
                obj.pread = permissions[i].read;
                obj.pwrite = permissions[i].write;
                obj.pcreate = permissions[i].create;
                obj.pdelete = permissions[i].delete;

                break;
            }
        }
    }

    return obj;
}

